import React from 'react';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';
import Button from '../button/Button';

const Todo = ({ item }) => {
  const navigate = useNavigate();
  const goToDetail = () => {
    navigate(`/${item.id}`);
  };

  //일정삭제
  const todoListDeleteButton = () => {};

  return (
    <StyledTodoBox key={item.id} onClick={goToDetail}>
      <h4>제목: {item.title}</h4>
      <p>id: {item.id}</p>
      <p>내용: {item.content}</p>
      <p>schedule: {item.schedule}</p>
      <p>이름: {item.userId}</p>
      <p>비밀번호: {item.userPw}</p>
      <p>마감일: {item.doneDate}</p>
      <p>시작일: {item.startDate}</p>
      <Button onClick={todoListDeleteButton}>일정삭제</Button>
    </StyledTodoBox>
  );
};

export default Todo;

const StyledTodoBox = styled.div`
  border: 1px solid black;
`;
